proxy-groups:
  - name: "PROXY"
    type: url-test
    url: "http://www.google.com/generate_204"
    hidden: false
   # interval: 180
    tolerance: 500000
    icon: "https://cdn.jsdelivr.net/gh/MoGuangYu/Surfing@rm/Home/icon/All.svg"
    proxies:
      - "Auto"
      - "fallback"
      - "US"
      - "Persian Gulf"
      - "PK"
      - "DK"
  - name: "Auto"
    type: url-test
    url: "https://www.google.com/generate_204"
    exclude-filter: "timeout|connection refused|||ctb|Expired|If|Renewal|Email|||||||||||"
    interval: 280
    tolerance: 5000
    exclude-type: "direct"
    include-all-providers: true
    include-all-proxies: true
    hidden: false
    icon: "https://raw.githubusercontent.com/abbasdvd3/clash/refs/heads/main/provide/Azadi.jpg"

  - name: "fallback"
    type: fallback
    url: "https://www.google.com/generate_204"
    exclude-filter: "timeout|connection refused|||ctb|Expired|If|Renewal|Email|||||||||||"
    interval: 180
    exclude-type: "direct"
    include-all-providers: true
    include-all-proxies: true
    hidden: false
    icon: "https://raw.gitmirror.com/Koolson/Qure/master/IconSet/Color/Airport.png"

  - name: "US"
    icon: "https://cdn.jsdelivr.net/gh/MoGuangYu/Surfing@rm/Home/icon/US.svg"
    filter: "^(?=.*(|||||||||||||US|United States)).*$"
    exclude-filter: "timeout|connection refused|||ctb|Expired|If|Renewal|Email|||||||||||"
    type: url-test
    interval: 18
    tolerance: 5000
    exclude-type: "direct"
    include-all-providers: true
    include-all-proxies: true
    hidden: false
    url: "http://www.google.com/generate_204"

  - name: "Persian Gulf"
    icon: "https://raw.githubusercontent.com/abbasdvd3/clash/refs/heads/main/provide/freedom.webp"
  #  exclude-type: "direct|Shadowsocks|Shadowsocksr|vless|trojan|vmess|socks5|http"
    exclude-filter: "timeout|connection refused|||ctb|Expired|If|Renewal|Email|||||||||||"
    type: url-test
    interval: 18
    tolerance: 50000
    include-all-providers: false
    include-all-proxies: true
    hidden: false
    url: "http://www.google.com/generate_204"
    
  - name: "PK"
    type: url-test
    url: "https://www.google.com/generate_204"
    exclude-filter: "timeout|connection refused|||ctb|Expired|If|Renewal|Email|||||||||||"
    interval: 180
    tolerance: 5000
    include-all-providers: false
    include-all-proxies: true
    exclude-type: "direct"
    hidden: false
    icon: "https://raw.githubusercontent.com/abbasdvd3/clash/refs/heads/main/provide/Azadi.jpg"
    
  - name: "DK"
    type: url-test
    url: "https://www.google.com/generate_204"
    exclude-filter: "timeout|connection refused|||ctb|Expired|If|Renewal|Email|||||||||||"
    interval: 180
    tolerance: 5000
    include-all-providers: false
    include-all-proxies: true
    exclude-type: "direct"
    hidden: false
    icon: "https://raw.githubusercontent.com/abbasdvd3/clash/refs/heads/main/provide/Azadi.jpg"
    
  - name:  Direct
    type: select
    filter: ""
    exclude-filter: ""
    hidden: false
    icon: ""
    proxies:
      - DIRECT
      - PROXY
      - PASS
    
  - name:  Reject
    type: select
    hidden: false
    icon: ""
    proxies:
      - REJECT
      - DIRECT
      - PASS
    
